import light from '../image/light.svg'

const Content = () => {
    return (
        <main>
            <div>
                <h1>Top Official</h1>
                <p>DarkMode Workshop</p>
            </div>
            <img src={light} alt="Logo"/>
        </main>
    )
}

export default Content
